import React from "react";
import "./CompaniesSection.css";

const companies = [
  "Koochi Poochi", "Sreeleathers", "THR3LETTER", "Quniaa",
  "Stile Adda", "Carrydreams", "COMMN SENS", "KALALOM",
  "DENNISON", "Sosuya", "British Trolley", "Natraj Jewellers"
];

const CompaniesSection = () => {
  return (
    <section className="companies-section">
      <h2>People we've trained work at</h2>
      <div className="companies-grid">
        {companies.map((company, index) => (
          <div className="company-name" key={index}>
            {company}
          </div>
        ))}
      </div>
    </section>
  );
};

export default CompaniesSection;
